  this.targetDocPoint = targetDocPoint;
  this.scaledDocPoint = scaledDocPoint;
  this.in = in;
  this.targetDocID = targetDocID;
  this.numDims = numDims;
  this.bytesPerDim = bytesPerDim;
  this.b = b;
}

